--##################################################
--CREATING TABLES
--##################################################

CREATE TABLE regions(
region_id NUMBER CONSTRAINT PK_REGIONS_REGIONID PRIMARY KEY,
region_name VARCHAR2(50) NOT NULL);

CREATE TABLE countries(
country_id CHAR(2) CONSTRAINT PK_COUNTRIES_COUNTRYID PRIMARY KEY,
country_name VARCHAR(40) NOT NULL,
region_id NUMBER CONSTRAINT FK_COUNTRIES_REGIONID REFERENCES REGIONS);

CREATE TABLE locations(
location_id NUMBER CONSTRAINT PK_LOCATIONS_LOCATIONID PRIMARY KEY,
address VARCHAR2(255) NOT NULL,
postal_code VARCHAR2(20),
city VARCHAR2(50),
state VARCHAR2(50),
country_id CHAR(2) CONSTRAINT FK_LOCATIONS_COUNTRYID REFERENCES COUNTRIES);

ALTER TABLE countries
MODIFY country_name VARCHAR2(40) NOT NULL;

CREATE TABLE warehouses(
warehouse_id NUMBER CONSTRAINT PK_WAREHOUSES_WAREHOUSEID PRIMARY KEY,
warehouse_name VARCHAR(255),
location_id NUMBER(12,0) CONSTRAINT FK_WAREHOUSES_LOCATIONID REFERENCES LOCATIONS);

CREATE TABLE employees(
employee_id NUMBER CONSTRAINT PK_EMPLOYEES_EMPLOYEEID PRIMARY KEY,
first_name VARCHAR(255) NOT NULL,
last_name VARCHAR(255) NOT NULL,
email VARCHAR(255) NOT NULL,
phone VARCHAR(50) NOT NULL,
hiredate DATE NOT NULL,
manager_id NUMBER(12,0) CONSTRAINT FK_EMPLOYEES_MANAGERID REFERENCES EMPLOYEES,
job_title VARCHAR(255) NOT NULL);

CREATE TABLE product_categories(
category_id NUMBER CONSTRAINT PK_PROCAT_CATEGORYID PRIMARY KEY,
category_name VARCHAR2(255) NOT NULL);

CREATE TABLE products(
product_id NUMBER CONSTRAINT PK_PRODUCTS_PRODUCTID PRIMARY KEY,
product_name VARCHAR2(255) NOT NULL,
description VARCHAR2(2000),
standard_cost NUMBER(9,2),
list_price NUMBER(9,2),
category_id NUMBER NOT NULL CONSTRAINT FK_PRODUCTS_CATEGORYID REFERENCES PRODUCT_CATEGORIES);

CREATE TABLE customers(
customer_id NUMBER CONSTRAINT PK_CUSTOMERS_CUSTOMERID PRIMARY KEY,
name VARCHAR2(255) NOT NULL,
address VARCHAR2(255),
website VARCHAR2(255),
credit_limit NUMBER(8,2));

CREATE TABLE contacts(
contact_id NUMBER CONSTRAINT PK_CONTACTS_CONTACTID PRIMARY KEY,
first_name VARCHAR2(255) NOT NULL,
last_name VARCHAR2(255) NOT NULL,
email VARCHAR2(255) NOT NULL,
phone VARCHAR2(20),
customer_id NUMBER CONSTRAINT FK_CONTACTS_CUSTOMERID REFERENCES CUSTOMERS);

CREATE TABLE orders(
order_id NUMBER CONSTRAINT PK_ORDERS_ORDERID PRIMARY KEY,
customer_id NUMBER(6,0) NOT NULL CONSTRAINT FK_ORDERS_CUSTOMERID REFERENCES CUSTOMERS,
status VARCHAR(20) NOT NULL,
salesman_id NUMBER(6,0) CONSTRAINT FK_ORDERS_SALESMANID REFERENCES EMPLOYEES,
order_date DATE NOT NULL);

CREATE TABLE order_items(
order_id NUMBER(12,0),
item_id NUMBER(12,0),
product_id NUMBER(12,0) NOT NULL,
quantity NUMBER(8,2) NOT NULL,
unit_price NUMBER(8,2) NOT NULL,
CONSTRAINT PK_ORDERITEMS_ORDERITEM PRIMARY KEY(order_id,item_id),
CONSTRAINT fk_order_items_products 
      FOREIGN KEY( product_id )
      REFERENCES products( product_id ) 
      ON DELETE CASCADE,
    CONSTRAINT fk_order_items_orders 
      FOREIGN KEY( order_id )
      REFERENCES orders( order_id ) 
      ON DELETE CASCADE
  );

CREATE TABLE inventories(
product_id NUMBER(12,0),
warehouse_id NUMBER(12,0),
quantity NUMBER(8,0) NOT NULL,
CONSTRAINT pk_inventories 
      PRIMARY KEY( product_id, warehouse_id ),
    CONSTRAINT fk_inventories_products 
      FOREIGN KEY( product_id )
      REFERENCES products( product_id ) 
      ON DELETE CASCADE,
    CONSTRAINT fk_inventories_warehouses 
      FOREIGN KEY( warehouse_id )
      REFERENCES warehouses( warehouse_id ) 
      ON DELETE CASCADE
  );

