--###############################################
--select query examples
--###############################################

SELECT 
    region_id,region_name 
FROM 
    regions;
    
SELECT 
    country_name 
FROM 
    countries;   


--################################################
--ORDER BY
--################################################

SELECT
    name,
    address,
    credit_limit
FROM
    customers
ORDER BY
    name ASC;
    

SELECT
    name,
    address,
    credit_limit
FROM
    customers
ORDER BY
    name DESC;
    
    
SELECT
	first_name,
	last_name
FROM
	contacts
ORDER BY
	first_name,
	last_name DESC;


SELECT
    country_id,
    city,
    state
FROM
    locations
ORDER BY
    city,
    state;


SELECT
    order_id,
    status,
    order_date
FROM
    orders
ORDER BY
    order_date ASC NULLS FIRST;
    
    